import React from "react";
import HeaderSection from "./HeaderSection/HeaderSection";
import ProfileSection from "./ProfileSection/ProfileSection";
import Footer from "./Footer/Footer";

function App() {
  return (
    <div>
      <HeaderSection />
     <ProfileSection />

      <Footer/>
    </div>
  );
}

export default App;
